                suggestionToolTip
            </Tooltip>
        );
    }

    return (

        <div>


            {props.suggestion.map(suggestion => {

                let suggestionToolTip = room.suggestion[0].suggestion;

                return (

                <OverlayTrigger
                                        placement="right"
                                        delay={{ show: 250, hide: 400 }}
